Circulating cassettes have Box Of Rain and Jack Straw labeled as part of a sound check for this show, but also appear as filler on other dates so this date is entirely speculative - there is no corraborative evidence.
This is a 12-beat Beat it on Down the Line. During the transition from China Cat to I Know You Rider, Jerry plays a few riffs of the Mountain Jam; {Dark Star 0:00 > First Verse 12:25 to 13:35 > end 19:15; Playing In The Band [2:43] > Jam [10:23] > Playing In The Band [1:56]}

